import { FC } from "react";
import { Outlet } from 'react-router';
import { Header } from "./issues/components/Header";
import { ToastContainer } from 'react-toastify';

export const App: FC = () => {

  return (
    <div>
      <Header />
      <div className="container">
      <ToastContainer />

        <Outlet />
      </div>
    </div>
  );
}

export default App;
